import React from 'react';
import styled from 'styled-components';
import Logo from '../../logo.svg';
import { Link } from "react-router-dom";
import { Container, Grid, Segment, Header, Form, Button, Input, Divider } from 'semantic-ui-react';

const User = () => {

    return (
        <Page>
           <div className="header-top">
                <Image src={Logo} alt="" />
                <Link to="/"><span className="logo-font">ART<strong style={{ color: '#a5673f' }}>COFFEE</strong></span></Link>
           </div>

           <Container>
                <Grid centered columns={1}>
                    <Grid.Column style={{ maxWidth: 450 }}>
                        <Segment>
                            <Header
                                as='h2'
                                content='Cadastro de Usuários'
                                subheader='Entre com os daods do usuários'
                            />

                            <Divider />

                            <Form>
                                <Form.Field>
                                    <Input icon='user' iconPosition='left' placeholder='Nome Completo' />
                                </Form.Field>
                                <Form.Field>
                                    <Input icon='mail' iconPosition='left' placeholder='E-mail' />
                                </Form.Field>
                                <Form.Field>
                                    <Input icon='user' iconPosition='left' placeholder='user' />
                                </Form.Field>
                                <Form.Field>
                                    <Input icon='lock' iconPosition='left' placeholder='password' />
                                </Form.Field>
                                <Button type='submit' fluid color="brown">Cadastrar</Button>
                            </Form>
                        </Segment>
                    </Grid.Column>
                </Grid>
           </Container>
        </Page>
    )
}

export default User;

const Page = styled.div`
    .ui.grid {
        margin-top: 30px;
    }
    .header-top {
        text-align: center;
        padding: 40px 0;
        background-color: #f7f7f7;
    }
    .logo-font {
        text-transform: lowercase;
        font-size: 1.4em;
        color: black;
    }
    .header {
        text-align: center
    }
    button {
        padding: 20px 0;
    }
`

const Image = styled.img`
    height: 50px;    
    margin-right: 10px
`
